import {Redirect} from 'react-router-dom';

class Appointment extends Component {

    history = useHistory()

    handleClick = event => {
        console.log(`reserve ${this.props.when}`)
        this.props.requestDate(this.props)
        return <Redirect to={`/locations/${this.props.key}`} />
        // this.props.history.push(`/locations/${this.props.key}`)
    }



    render () {
        return (
            <div id={this.props.key} status= {this.props.status}> {new Date(this.props.when).toString().substr(0,21)}<button onClick={event => this.handleClick(event)}>submit request</button></div>
        )
    }
}

export default Appointment
